import React from "react";
import { data } from "../helper/data";

const CardContainer = () => {
  return (
    <div>
      <div>
        <input type="text" name="" id="" placeholder="Search Player..." />
      </div>
      <div className="card-container">
        {data.map((player) => (
          <Card
            name={player.name}
            img={player.img}
            statistics={player.statistics}
          />
        ))}
      </div>
    </div>
  );
};

export default CardContainer;
